import React from 'react';
import Home from './components/Home';
import Nav from './components/Nav';
import Profile from './components/Profile';
import Service from './components/Service';

function App() {
  return (
    <div>
      <Home />
      <Nav />
      <Profile />
      <Service />
    </div>
  );
}

export default App;
